import React from 'react';

import { SpinnerContainer, SpinnerOverlay } from '../with-spinner/WithSpinner.styles';

const WithSpinner =  WrappedComponent => {
  const Spinner = ({ isLoading, ...otherProps }) => {
    return isLoading ? (
      <SpinnerOverlay>
        <SpinnerContainer />
      </SpinnerOverlay>
    ) : (
      <WrappedComponent { ...otherProps } />
    );
  };
  return Spinner;
};

export default WithSpinner;
